import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  grid-area: nav;
  text-align: center;
`;

const Navigation = () => {
  return (
    <Container className="nav">
      Bishop and Polden
    </Container>
  );
};

export default Navigation;
